TITLE:
  - stationary Kim-Moin with density 5 with solving eigenvalue problem for
  - nitsche parameter
PROBLEM TYPE:
  PROBLEMTYPE: "Fluid_XFEM"
FLUID DYNAMIC:
  LINEAR_SOLVER: 1
  TIMEINTEGR: "Stationary"
  NONLINITER: Newton
  INITIALFIELD: "field_by_function"
  CALCERROR: kimmoin_stat_navier_stokes
  ADAPTCONV: true
  RESTARTEVERY: 0
  STARTFUNCNO: 2
  TIMESTEP: 1
  MAXTIME: 1
  THETA: 1
FLUID DYNAMIC/NONLINEAR SOLVER TOLERANCES:
  TOL_VEL_RES: 1e-10
  TOL_VEL_INC: 1e-10
  TOL_PRES_RES: 1e-10
  TOL_PRES_INC: 1e-10
FLUID DYNAMIC/RESIDUAL-BASED STABILIZATION:
  STABTYPE: "edge_based"
  PSPG: false
  SUPG: false
  GRAD_DIV: false
  DEFINITION_TAU: "Taylor_Hughes_Zarins_Whiting_Jansen_wo_dt"
FLUID DYNAMIC/EDGE-BASED STABILIZATION:
  EOS_PRES: "std_eos"
  EOS_CONV_STREAM: "std_eos"
  EOS_DIV: "vel_jump_std_eos"
  EOS_DEFINITION_TAU: "Burman_Fernandez"
  EOS_H_DEFINITION: EOS_he_max_dist_to_opp_surf
XFEM GENERAL:
  VOLUME_GAUSS_POINTS_BY: "DirectDivergence"
XFLUID DYNAMIC/GENERAL:
  XFLUIDFLUID: true
XFLUID DYNAMIC/STABILIZATION:
  NIT_STAB_FAC: 2
  VISC_STAB_TRACE_ESTIMATE: "eigenvalue"
  VISC_STAB_HK: "vol_equivalent"
  GHOST_PENALTY_STAB: true
  GHOST_PENALTY_FAC: 0.003
SOLVER 1:
  SOLVER: "Belos"
  IFPACKGFILL: 3
  AZOUTPUT: 50
  AZREUSE: 1
  AZSUB: 1000
  NAME: "Fluid_Solver"
MATERIALS:
  - MAT: 1
    MAT_fluid:
      DYNVISCOSITY: 0.5
      DENSITY: 5
      GAMMA: 1
  - MAT: 2
    MAT_Struct_StVenantKirchhoff:
      YOUNG: 1e+11
      NUE: 0
      DENS: 0
FUNCT1:
  - FLUID_FUNCTION: "KIMMOIN-RHS"
    MAT: 1
    ISSTAT: 1
    ISSTOKES: 0
FUNCT2:
  - FLUID_FUNCTION: "KIMMOIN-UP"
    MAT: 1
    ISSTAT: 1
DESIGN VOL NEUMANN CONDITIONS:
  - E: 1
    NUMDOF: 6
    ONOFF: [1, 1, 1, 0, 0, 0]
    VAL: [1, 1, 1, 0, 0, 0]
    FUNCT: [1, 1, 1, 0, 0, 0]
  - E: 2
    NUMDOF: 6
    ONOFF: [1, 1, 1, 0, 0, 0]
    VAL: [1, 1, 1, 0, 0, 0]
    FUNCT: [1, 1, 1, 0, 0, 0]
DESIGN POINT DIRICH CONDITIONS:
